import React from 'react';
import styled from "styled-components";
import user from '../asstets/img/user.svg'
import settings from "../asstets/img/settings.svg";


const SettingsWrapper = styled.div`
      display: flex;
      //justify-content: center;
      //align-items: center;
      flex-direction: column;
      margin: 0 auto;
      width: 60vw;
      background-color: orange;
`;

const UserCard = styled.div`
      display: flex;
      //justify-content: space-between;
      margin: 0 auto;
      //align-items: center;
`

const UserAvatarWrapper = styled.img`
      //margin: 0 auto;
      margin: 20px;
      width: 75px;
      height: 75px;
`
const UserMailWrapper = styled.div`
     display: flex;
     //justify-content: center;
     //align-items: center;
     flex-direction: column;
`
const Button = styled.button`
    padding: 20px 30px;
    margin-top: 30px;
    width: 170px;
    height: 50px;
    outline: none;
    border: none;
    font-size: 20px;
    font-weight: 600;
    letter-spacing: 5px;
    border-radius: 5px;
    cursor: pointer;
    background: ${({theme}) => theme.colors.pink};
    color: grey;
`

const SettingsCard = () => (

    <SettingsWrapper>
        <UserCard>
            <UserAvatarWrapper src={user} alt="Avatar icon"/>

            <UserMailWrapper>Jeste≈õ zalogowany jako Mati Mati @
                <Button> Wyloguj</Button>
            </UserMailWrapper>
        </UserCard>
    </SettingsWrapper>
)

export default SettingsCard;
